import {
    USERS
  } from '../utils/url.constants';

  export const getUsers = (successCallback, errorCallback) => {
    apiRequest({
      url: USERS,
      method: 'get',
      data: {
      },
      onSuccess: response => { successCallback(response) },
      onError: error => { errorCallback(error) }
    })
  }
